// Returns the name of the area in which the given |position| is located, or "San Andreas" when the
// given |position| is not in a known area. Iterates through all entries in the |kLocations| array.
export function getAreaNameForPosition(position) {
    const matches = [];

    for (const location of kLocations) {
        if (!location.area.contains(position))
            continue;
        
        if (location.minZ > position.z || location.maxZ < position.z)
            continue;

        matches.push({ name: location.name, area: location.area.area });
    }

    if (!matches.length)
        return 'San Andreas';

    matches.sort((lhs, rhs) => {
        return lhs.area > rhs.area ? 1 : -1;
    });

    return matches[0].name;
}
